import React, { Component }  from 'react';
import Clarifai from 'clarifai';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import Particles from 'react-particles-js';
import FaceRecogntion from './components/FaceRecogntion/FaceRecogntion';
import './App.css';



const app = new Clarifai.App({
 apiKey: 'a74ede1d3b8f43928097696c5d7285fa'
});



const particlesOptions = {

  particles: {
    number: {
      value: 40,
      density: {
        enable: true,
        value_area: 400

      }   
    }
  }
}

class App extends Component {

  constructor(){
    super();
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) =>
  {
    console.log(event.target.value);
  }

  onButtonSubmit = () => {
    console.log('click');

    app.models.predict("{d02b4508df58432fbb84e800597b8959}",
     ["https://clarifai.com/cms-assets/20180320221615/face-001.jpg"])
     .then(
      function(response) {
      // do something with response
      console.log(response);
      },
      function(err) {
      // there was an error
      }
    );
  }

  render() {
    return (
      <div className="App">
        <Particles className='particles'
        params={particlesOptions}
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm  
          onInputChange={this.onInputChange} 
          onButtonSubmit={this.onButtonSubmit}/>
        <FaceRecognition />
      </div>
    );
  }
}

export default App;
